2)\nypahi (73)\nsmfpql (132) -> gwbssq, khyucl\nelndeja (76)\nreffy (174) -> rrcgjc, gytimq\ntnncdvi (85)\nyvaua (107) -> fnxgxy, fiiscny\nuokbqcq (46)\nyuqdsv (135) -> icicush, obohol\ntefvwb (7)\nqhqhx (72)\nipnia (88) -> ichekvx, uepkk, agzekk, isdwz, nwfivan, ashso, niziq\nrqqcyu (71)\noebbzys (2065) -> cxbcib, rpbmn, muhtyvc\nmqgxx (92)\nljgrn (206) -> jvkuwnl, acdth\nhjzjhbc (53)\njexxxx (13676) -> qlrshn, zqparby, etxasz, tpqkb\nzunvrg (62)\nhybiw (685) -> ggvhbb, fcicnl, uinbm, ckavnt, lcdnv\nzbuzek (50)\njbvxahe (40)\nymobi (1131) -> qsilzzo, vxnrpq, yxgken\ngrvzg (55) -> roihpx, yvfltrt, odlntvv, rraaooy, otfbit, jcfix\noxcetg (86) -> qvzryn, yjbucib\nemknkrh (47)\ndorcc (39)\nniexrb (75)\nnwemm (27)\nqntfrg (1574) -> jndpmw, pnxeoq, tujlwef\nfcfsd (95)\nbgteja (315)\nqmjdqb (9998) -> qazjql, yklbe, jkzcn\navefgw (196) -> mrkxs, dppmh, qusruqc\nfrhsix (34)\ntulwp (264) -> dygbnr, wufaj, oxcetg, gbfjjv, xnfpxnd, oxvjudn, anongb\nlxuwkr (16)\nzczzj (89)\nxszevpx (8)"
  val inputraw = "pbga (66)\nxhth (57)\nebii (61)\nhavc (66)\nktlj (57)\nfwft (72) -> ktlj, cntj, xhth\nqoyq (66)\npadx (45) -> pbga, havc, qoyq\ntknk (41) -> ugml, padx, fwft\njptl (61)\nugml (68) -> gyxo, ebii, jptl\ngyxo (61)\ncntj (57)"
  var input = inputraw.split("\n").toList

//  val pattern = "([a-z])+ \\(([0-9]+)\\)(?: -> ([A-Za-z, ]+))?".r
  val pattern = "([a-z]+) \\(([0-9]+)\\)".r
  val patternWithChildren = "([a-z]+) \\(([0-9]+)\\) -> ([A-Za-z, ]+)".r


  val programs: List[Program] = input.map(_ match {
    case pattern(name, weight) => Program(name, weight.toInt, Set())
    case patternWithChildren(name, weight, children) =>  Program(name, weight.toInt, children.split(", ").toSet)
    case _ => println("no pattern match!")
  }).map(_.asInstanceOf[Program])

  println(input)
  println(programs)

  // We can now look at all programs that have children. We add all names to a set, and all children names to another set.
  var names = scala.collection.mutable.Set[String]()
  var childrenNames = scala.collection.mutable.Set[String]()

  val programsWithChildren = programs.filter(_.children.size > 0)
  programsWithChildren.foreach(p => {
      p.children.foreach(childrenNames.add)
      names.add(p.name)
  })

  // We should find the root name, because it is not in the set of childrenNames!
  println(names.diff(childrenNames))
}
